import { withRouter } from "react-router";
import { observable, computed, decorate } from "mobx"

class TodoList {
    price = 0
    amount = 1

    get total() {
        return this.price * this.amount
    }
}
decorate(TodoList, {
  price: observable,
  amount: observable
})

export default withRouter(TodoList);
